import React, { Component } from "react";
import { Form, Input, Button, Row, Col, DatePicker } from 'antd';


const layout = {
    labelCol: { span: 8 },
    wrapperCol: { span: 16 },
};
const tailLayout = {
    wrapperCol: { offset: 8, span: 16 },
};



export default class AddParentRelease extends Component {


    onFinish = (values) => {

        console.log("on ifinsh", values)
        console.log("Date", values['startDate'].format('YYYY-MM-DD'))
    }
    onFinishFailed = () => {
        console.log("on ifinsh failed")
    }
    render() {
        return (
            <div>
                <Form
                    name="basic"
                    initialValues={{ remember: true }}
                    onFinish={this.onFinish}
                    onFinishFailed={this.onFinishFailed}
                >
                    <Row>
                        <Col span={4}>
                            <Form.Item
                                label="version"
                                name="version"
                                rules={[{ required: true, message: 'Please input your version!' }]}
                            >
                                <Input />
                            </Form.Item>
                        </Col>
                        <Col span={4}>
                            <Form.Item label="start Date" name="startDate"  >
                                <DatePicker />
                            </Form.Item>

                        </Col>
                        <Col span={4}>
                            <Form.Item label="end Date" name="endDate">
                                <DatePicker />
                            </Form.Item>

                        </Col>

                        <Col span={4}>
                            <Form.Item
                                label="Description"
                                name="Description"
                            >
                                <Input />
                            </Form.Item>

                        </Col>
                        <Col span={4}>
                            <Form.Item {...tailLayout}>
                                <Button type="primary" htmlType="submit">
                                    Submit
                            </Button>
                            </Form.Item>
                        </Col>
                    </Row>
                </Form>
            </div>
        )
    }
}
